class Laser_Light:
    """ If using monocromatic light as incident """
    def __init__(self, spectrum, stack):

        AM_data = AM_spectra(stack.spectrum, stack)
        eVs = AM_data.energies
        energy=spectrum[1]  # laser energy
        standardization_scheme=spectrum[2]
        """ Used for monochromatic incident light with irradiance given in suns and photon energy given in eV.  """
        self.energy = energy # (eV)
        index = np.searchsorted(eVs, energy)
        Eg = stack.bandgap # bandgap (eV)
        n_per_eV_AM = AM_data.n_per_eV  # (s^-1 m^-2 eV^-1)  # this brings in the concentration factor "stack.concentration"
        
        if standardization_scheme == 'photocurrent':
            """ We must find the laser one-sun equivalent to one-sun by setting laser photocurrent equal to hypothetical one-sun AM1.5G photogeneration. like https://books.google.com/books?id=uJnIAwAAQBAJ&pg=PA247&lpg=PA247&dq=definition+%22one+sun%22+monochromatic+light&source=bl&ots=6q9QgA00co&sig=ACfU3U1AyrjamZ0oretpSWQCokcXWxPC-g&hl=en&sa=X&ved=2ahUKEwi3s6GHyMjoAhUMo54KHTHZBWMQ6AEwAHoECAwQLA#v=onepage&q=definition%20%22one%20sun%22%20monochromatic%20light&f=false "Quantitative Recombination Transport Propoerties in Silicon from Dynamic Luminescence." Eq. A.51"""
            try:
                absorptance = stack.photocollection.absorptance  
            except:
                import spectral
                absorptance = spectral.Absorption(Eg, stack).absorptance
            from spectral import find_QY
            QY = find_QY(eVs, Eg, stack) # relevant if using Multi-Exciton Generation (MEG)
            step_fun_absorptance = [(1 if(E>stack.bandgap) else 0) for E in eVs] # creating fixed absorptance allows Jsc to be fixed with reflectance and thickness
            photocurrent = trapz(QY*step_fun_absorptance*n_per_eV_AM, eVs)/(QY[index]*absorptance[index])  # this is hypothetical absorbed photocurrent under AM1.5G needed to keep Jsc fixed.
            incicurrent = photocurrent/(QY[index]*absorptance[index])  # this is incident photocurrent
            print(incicurrent)
            self.irradiance = incicurrent*(q*energy)
      
        else:
            AM_data = AM_spectra(stack.spectrum, stack)
            self.irradiance = stack.concentration*1000
            incicurrent = self.irradiance/(q*energy)

        spectral_incicurrent = incicurrent/((eVs[index+1]-eVs[index-1])/2)  # Divide by interval width to convert s^-1 m^-2  to  s^-1 m^-2 eV^-1.
        n_per_eV = np.zeros(len(eVs))  # (s^-1 m^-2 eV^-1)
        n_per_eV[index] = spectral_incicurrent
        self.n_per_eV = n_per_eV




class Incident_Light:
   """ This class handles the different data for incident light - except for blackbody light.
   Blackbody photon flux (n_per_eV) would be computed elsewhere to increase accuracy/speed."""

   def __init__(self, spectrum, stack, extra=0, Eg=0):
      AM_data = AM_spectra(stack.spectrum, stack)
      energies = AM_data.energies 
      self.energies = energies 
      
      if spectrum[0:2] == 'AM':
         n_per_eV = AM_data.n_per_eV  # spectral photon flux (1/(s m^2 eV))
         self.n_per_eV = n_per_eV
         self.irradiance = AM_data.irradiance  # (W/m^2)
      if spectrum[0:2] == 'Blackbody':
         self.irradiance = stack.concentration*f*Stefan_Boltzmann*stack.T_sun**4  # (W/m^2)
      if spectrum[0] == 'Laser':
         light = Laser_Light(stack.spectrum, stack)
         self.n_per_eV= light.n_per_eV
         self.irradiance = light.irradiance
         
      if extra==1:  # calculate extra thermodynamic quantities for occasional use
          E_per_eV = self.n_per_eV*(q*energies)  # (W/m^2/eV)
          self.E_per_eV = E_per_eV  
          Eg_index = np.searchsorted(energies, Eg)
          energies_above = energies[Eg_index:-1]
          E_per_eV_above = E_per_eV[Eg_index:-1]
          n_per_eV_above = self.n_per_eV[Eg_index:-1]
          E_sun_avg = trapz(E_per_eV_above, energies_above)/trapz(n_per_eV_above, energies_above)/q  # (eV) from Thermodynamics of light management in photovoltaic devices Eq 15 
          VocCarnot =  E_sun_avg*(1-stack.T_cell/stack.T_sun)  # Gets photons energy per eV window in units of W/m^2/eV
          self.E_sun_avg = E_sun_avg
          self.VocCarnot = VocCarnot     
          
          
          
          